    getPredictTypeMenu(){
        return Object.keys(this.PREDICT_TYPE_INFO).map(key => ({
            text: this.PREDICT_TYPE_INFO[key].name,
            value: key
        }));
    }

    /**
     * Finds the type of name specified in the menu from the text in the predict block.
     * @param {*} args
     * @returns
     */
    getPredict1( args ) {
        const text = Cast.toString(args.TEXT);
        //const predictType = this.PREDICT_TYPE_INFO[args.PREDICTTYPE].predictType;

        var predict = {
            PredictType: 1,
            Text: text
        }

        const path = "https://fzscratch.azurewebsites.net/api/predict/";
        //const path = "https://localhost:5001/api/predict/";

        var pr = fetch(path, {
            method: "POST",
            headers: {
                "Accept": "application/json",
                "Content-Type": "application/json"
            },
            body: JSON.stringify(predict)
        })
        .then(res => res.json())
        .then(function(data) {
            console.log(data);
            var result = data["predict"];
            if (result === ""){
                result = "見つかりません";
            }
            return result;
        })
        .catch(err => 'エラー');

        return pr;
    }

